const valueHasNotBeenSetMessage = 'value has not been set';

let scene = {
  canvas: document.createElement('canvas'),
  elements: [],
  //handling functions
  handleName: () => {
    return valueHasNotBeenSet;
  },
  handleColor: () => {
    return valueHasNotBeenSet;
  },
  handlePosition: () => {
    return valueHasNotBeenSet;
  },
  handleXCord: () => {
    return valueHasNotBeenSet;
  },
  handleYCord: () => {
    return valueHasNotBeenSet;
  },
  //drawing functions
  drawRect: () => {
    return valueHasNotBeenSetMessage;
  },
  drawPath: () => {
    return valueHasNotBeenSetMessage;
  },
  drawArc: () => {
    return valueHasNotBeenSetMessage;
  },
  start: (data) => {
    //setting canvas values
    scene.canvas.width = data.width;
    scene.canvas.height = data.height;
    scene.context = scene.canvas.getContext('2d');
    const context = scene.context;

    //scene functions
    function addToScene(name, element) {
      scene.elements.push({ name, element });
    }

    //handling element variables
    scene.handleName = (name) => {
      return name == null || name === ''
        ? `element${scene.elements.length}`
        : name;
    };
    const handleName = scene.handleName;

    scene.handleColor = (color) => {
      return color == null || color === '' ? 'black' : color;
    };
    const handleColor = scene.handleColor;

    scene.handlePosition = (position) => {
      return position.x == null ||
        position.y == null ||
        position.x > scene.canvas.width ||
        position.y > position.canvas.height
        ? { x: 0, y: 0 }
        : position;
    };
    const handlePosition = scene.handlePosition;

    scene.handleXCord = (x) => {
      return x == null || x > scene.canvas.width ? 0 : x;
    };
    const handleXCord = scene.handleXCord;

    scene.handleYCord = (y) => {
      return y == null || y > scene.canvas.height ? 0 : y;
    };
    const handleYCord = scene.handleYCord;

    //drawing function
    scene.drawRect = (data) => {
      //handling color
      const color = handleColor(data.color);
      context.fillStyle = color;

      //handling name
      const name = handleName(data.name);

      context.fillRect(
        data.position.x,
        data.position.y,
        data.size.x,
        data.size.y
      );
    };

    scene.drawPath = (data) => {
      //handling color
      const color = handleColor(data.color);

      //handling name
      const name = handleName(data.name);
      const startPos = data.startPos || data.startPosition;

      context.beginPath();
      context.moveTo(startPos.x, startPos.y);
      data.paths.forEach((path) => {
        context.lineTo(path.x, path.y);
      });

      context.strokeStyle = color;

      context.stroke();
    };

    scene.drawArc = (data) => {
      //handling color
      const color = handleColor(data.color);

      //handling name
      const name = handleName(data.name);

      const position = data.position;
      const radius = data.radius;
      const startAng = data.startAng || data.startAngle;
      const endAng = data.endAng || data.endAngle;
      const drawCounterClockWise =
        data.drawCounterClockWise == null ? false : data.drawCounterClockWise;

      context.beginPath();
      context.arc(
        position.x,
        position.y,
        radius,
        startAng,
        endAng,
        drawCounterClockWise
      );
      context.strokeStyle = color;
      context.stroke();
    };

    //appending canvas into the DOM
    data.sceneParent.append(scene.canvas);
  },
};

export default scene;
